import { FlareSharp } from "@material-ui/icons";
import React from "react";
import Main from "./Main";

export default class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      loginStatus: false,
    };
    this.getHome = this.getHome.bind(this);
  }
  handleLogin() {
    this.setState({ loginStatus: true });
  }

  render() {
    return (
      <div className="App">
        <Main />
      </div>
    );
  }
}
